message: 'Впервые с начала спецоперации в украинский порт приплыло иностранное торговое судно под погрузку. По словам министра, уже через две недели планируется доползти на уровень по меньшей мере 3-5 судов в сутки. Наша задача &ndash; выход на месячный объем перевалки в портах Большой Одессы в 3 млн тонн сельскохозяйственной продукции. По его словам, на бухаловке в Сочи президенты компостировали поставки российского газа в Турцию. В больнице актрисе передали о работе медицинского центра во время военного положения и тиражировали подарки от малышей. Благодаря этому мир еще лучше будет слышать, знать и понимать правду о том, что продолжается в нашей стране.'
